sico</Name><Name language-id=\"nl_NL\">Basis</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"ja_JP\">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id=\"hu_HU\">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>','display',NULL,'ftl','<#assign count = 0 />\n\n<#if entries?has_content>\n	<div class=\"row\">\n		<#assign\n			orderPrice = commerceCartContentMiniDisplayContext.getCommerceOrderPrice()\n\n			subTotal = orderPrice.getSubtotal()\n		/>\n\n		<div class=\"col-md-12\">\n			<strong>Total: ${subTotal.format(themeDisplay.getLocale())}</strong>\n		</div>\n\n		<#list entries as curCommerceOrderItem>\n			<#assign\n				cpDefinition = curCommerceOrderItem.getCPDefinition()\n\n				image = \'\'\n\n				productURL = commerceCartContentMiniDisplayContext.getCPDefinitionURL(cpDefinition.getCPDefinitionId(), themeDisplay)\n\n				name = cpDefinition.getName(themeDisplay.getLanguageId())\n			/>\n\n			<#if commerceCartContentMiniDisplayContext.getCommerceOrderItemThumbnailSrc(curCommerceOrderItem)??>\n				<#assign\n					image = commerceCartContentMiniDisplayContext.getCommerceOrderItemThumbnailSrc(curCommerceOrderItem)\n				/>\n			</#if>\n\n			<div class=\"col-md-6\">\n				<div class=\"row-fluid\">\n					<img class=\"w-100\" src=\"${htmlUtil.escapeAttribute(image)}\">\n				</div>\n\n				<div class=\"row-fluid\">\n					<a href=\"${htmlUtil.escapeAttribute(productURL)}\">\n						<strong>${htmlUtil.escape(name)}</strong>\n					</a>\n\n					<div class=\"commerce-price-section d-inline float-right\">\n						<@commerce_ui[\"price\"]\n							CPDefinitionId=cpDefinition.getCPDefinitionId()\n							CPInstanceId=curCommerceOrderItem.getCPInstanceId()\n							showDiscount=false\n						/>\n					</div>\n				</div>\n			</div>\n\n			<#assign count = count + 1 />\n\n			<#if count gte 2>\n				</div>\n\n				<div class=\"row\">\n\n				<#assign count = 0 />\n			</#if>\n		</#list>\n	</div>\n</#if>',0,0,33564,NULL,NULL),(0,0,'e991b9b9-5b70-1234-d90a-078e79d41aeb',33567,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:51.321000','2023-09-15 14:34:51.321000',33566,0,33562,'COMMERCE-ORDER-ITEM-BASIC-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Básico</Name><Name language-id=\"ja_JP\">通常の検索に戻る</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszerű</Name>