\n					/>\n\n					<#if languageUtil.isBetaLocale(entryLocale)>\n						<#assign displayName += \" [beta]\" />\n					</#if>\n\n					<@liferay_ui[\"icon\"]\n						icon=normalizedDefaultLanguageId\n						iconCssClass=\"inline-item inline-item-before\"\n						markupView=\"lexicon\"\n						message=displayName\n						url=entry.getURL()\n					/>\n				</#if>\n			</#list>\n		</@>\n	</div>\n</#if>',0,0,33589,NULL,NULL),(0,0,'e6ab75f9-a4cd-84cb-27f1-6ea8262d3217',33591,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:51.527000','2023-09-15 14:34:51.527000',33584,0,33562,'LANGUAGE-LONG-TEXT-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Lång text</Name><Name language-id=\"pt_BR\">Texto Longo</Name><Name language-id=\"ja_JP\">長いテキスト</Name><Name language-id=\"fr_FR\">Texte Long</Name><Name language-id=\"hu_HU\">Hosszú szöveg</Name><Name language-id=\"de_DE\">Langer Text</Name><Name language-id=\"ca_ES\">Text Llarg</Name><Name language-id=\"ar_SA\">نص طويل</Name><Name language-id=\"fi_FI\">Pitkä Teksti</Name><Name language-id=\"en_US\">Long Text</Name><Name language-id=\"zh_CN\">长文本</Name><Name language-id=\"es_ES\">Texto largo</Name><Name language-id=\"nl_NL\">Lange tekst</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar det fullständiga namnet på varje språk (t.ex. spanska).</Description><Description language-id=\"pt_BR\">Exibe o nome completo de cada idioma (por exemplo, Espanhol).</Description><Description language-id=\"ja_JP\">各言語 (スペイン語など) を完全な名前で表示します</Description><Description language-id=\"fr_FR\">Affiche le nom complet de chaque langue (e.x. espagnol).</Description><Description language-id=\"hu_HU\">Megjeleníti az egyes nyelvek te