nguage-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>','display',NULL,'ftl','<div class=\"row\">\n	<#assign\n		image = \'\'\n\n		title = \'\'\n\n		description = \'\'\n	/>\n\n	<#if cpCategoryContentDisplayContext.getDefaultImageSrc(themeDisplay)??>\n		<#assign\n			image = cpCategoryContentDisplayContext.getDefaultImageSrc(themeDisplay)\n		/>\n	</#if>\n\n	<#if assetCategory??>\n		<#assign\n			title = assetCategory.getTitle(locale)\n\n			description = assetCategory.getTitle(locale)\n		/>\n	</#if>\n\n	<div>\n		<img src=\"${htmlUtil.escapeAttribute(image)}\">\n	</div>\n\n	<div class=\"container-fluid container-fluid-max-xl\">\n		<h1>${htmlUtil.escape(title)}</h1>\n\n		<p>${htmlUtil.escape(description)}</p>\n	</div>\n</div>',0,0,33602,NULL,NULL),(0,0,'5f892755-9af0-09fe-1c6c-deaf744c4223',33604,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:51.667000','2023-09-15 14:34:51.667000',20007,0,33562,'ASSET-TAGS-NAVIGATION-COLOR-BY-POPULARITY-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Färga efter popularitet</Name><Name language-id=\"pt_BR\">Colorir por Popularidade</Name><Name language-id=\"ja_JP\">頻出度により色分けする</Name><Name language-id=\"fr_FR\">Couleur par popularité</Name><Name language-id=\"hu_HU\">Szín népszerűség alapján</Name><Name language-id=\"de_DE\">Nach Popularität färben</Name><Name language-id=\"ca_ES\">Color per popularitat</Name><Name language-id=\"ar_SA\">الألوان حسب الأولوية</Name><Name language-id=\"fi_FI\">Väri suosion mukaan</Name><Name language-id=\"en_US\">Color by Popularity</Name><Name language-id=\"zh_CN\">受欢迎的颜色</Name><Name language-id=\"es_ES\">Color por popularidad</Name><Name language-id=\"nl_NL\">Kleur op populariteit</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar tillgångstaggar färgade efter popularitet: röd (hög), gul (medelhög) och grön (låg).</Description><Description language-id=\"pt_BR\">Exibe marcadores coloridos por popularidade: vermelho (alta), amarelo (média) e verde (baixa).</Description><Description language-id=\"ja_JP\">アセットタグを人気順に表示する:赤(高い)、黄色（普通)、緑（低い）</Description><Description language-id=\"fr_FR\">Affiche les étiquettes d\'asset coloriées par popularité: rouge (élevé), jaune (moyen), et vert (bas).</Description><Description language-id=\"hu_HU\">Megjeleníti a tartalom címkéket népszerűség szerint színezve: vörös (magas), sárga (közepes), és zöld (alacsony).</Description><Description language-id=\"de_DE\">Schlagwörter nach Popularität färben: Rot (hoch), gelb (mittel), grün (niedrig).</Description><Description language-id=\"ca_ES\">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id=\"ar_SA\">يعرض علامات الأصول الملونة حسب الأولوية: الأحمر (مرتفع) والأصفر (متوسط) والأخضر (منخفض).</Description><Description language-id=\"fi_FI\">Näyttää sisältötageja, mitkä on väritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virheä (alhainen)</Description><Description language-id=\"en_US\">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description><Description language-id=\"zh_CN\">显示资源标签颜色等级： 红色 (高), 黄色 (中), 绿色 (低).</Description><Description language-id=\"es_ES\">Muestra las etiquetas de contenido coloreadas según su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id=\"nl_NL\">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n			scopedAssetCounts = assetTagsNavigationDisplayContext.getScopedAssetCounts()\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#if scopedAssetCounts??>\n				<#assign assetCount = scopedAssetCounts[entry.getName()] />\n			<#else>\n				<#assign assetCount = entry.getAssetCount() />\n			</#if>\n\n			<#if (assetCount > 0) || getterUtil.getBoolean(showZeroAssetCount)>\n				<#assign\n					maxCount = liferay.max(maxCount, assetCount)\n					minCount = liferay.min(minCount, assetCount)\n				/>\n			</#if>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<#if scopedAssetCounts??>\n				<#assign assetCount = scopedAssetCounts[entry.getName()] />\n			<#else>\n				<#assign assetCount = entry.getAssetCount() />\n			</#if>\n\n			<#if (assetCount > 0) || getterUtil.getBoolean(showZeroAssetCount)>\n				<li class=\"taglib-asset-tags-summary\">\n					<#assign popularity = (maxCount - (maxCount - (assetCount - minCount))) * multiplier />\n\n					<#if popularity < 1>\n						<#assign displayType = \"success\" />\n					<#elseif (popularity >= 1) && (popularity < 2)>\n						<#assign displayType = \"warning\" />\n					<#else>\n						<#assign displayType = \"danger\" />\n					</#if>\n\n					<#assign tagURL = renderResponse.createRenderURL() />\n\n					${tagURL.setParameter(\"resetCur\", \"true\")}\n					${tagURL.setParameter(\"tag\", entry.getName())}\n\n					<a class=\"label label-${displayType} tag\" href=\"${tagURL}\">\n						<span class=\"label-item label-item-expand\">${entry.getName()}</span>\n\n						<#if assetCount?? && getterUtil.getBoolean(showAssetCount)>\n							<span class=\"label-item label-item-after tag-asset-count\">(${assetCount})</span>\n						</#if>\n					</a>\n				</li>\n			</#if>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>',0,0,33605,NULL,NULL),(0,0,'96c9b948-115e-f973-8ebe-589f2f14f10d',33607,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:51.704000','2023-09-15 14:34:51.704000',28002,0,33562,'DOCUMENTLIBRARY-CAROUSEL-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Carousel</Name><Name language-id=\"pt_BR\">Carrossel</Name><Name language-id=\"ja_JP\">カルーセル</Name><Name language-id=\"fr_FR\">Carrousel</Name><Name language-id=\"hu_HU\">Körhinta</Name><Name language-id=\"de_DE\">Karussel</Name><Name language-id=\"ca_ES\">Carrussel</Name><Name language-id=\"ar_SA\">مكتبة</Name><Name language-id=\"fi_FI\">Karuselli</Name><Name language-id=\"en_US\">Carousel</Name><Name language-id=\"zh_CN\">轮播</Name><Name language-id=\"es_ES\">Carrusel</Name><Name language-id=\"nl_NL\">Carrousel</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar bilder i carousel-format.</Description><Description language-id=\"pt_BR\">Exibe imagens num carrossel.</Description><Description language-id=\"ja_JP\">カルーセル内に画像を表示</Description><Description language-id=\"fr_FR\">Affiche les images dans un carrousel.</Description><Description language-id=\"hu_HU\">Megjeleníti a képeket körhintaszerűen.</Description><Description language-id=\"de_DE\">Darstellung von Bildern in einem Karussell.</Description><Description language-id=\"ca_ES\">Mostra imatges en format carrusel.</Description><Description language-id=\"ar_SA\">يعرض الصور في مكتبة.</Description><Description language-id=\"fi_FI\">Näyttää kuvat karusellissa.</Description><Description language-id=\"en_US\">Displays images in a carousel.</Description><Description language-id=\"zh_CN\">把图片显示在转盘中。</Description><Description language-id=\"es_ES\">Muestra imágenes en un carrusel.</Description><Description language-id=\"nl_NL\">Geeft afbeeldingen weer in een carrousel.</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<style>\n		#<@portlet.namespace />carousel .carousel-item {\n			background-color: #000;\n			height: 250px;\n			overflow: hidden;\n			text-align: center;\n			width: 700px;\n		}\n\n		#<@portlet.namespace />carousel .carousel-item img {\n			max-height: 250px;\n			max-width: 700px;\n		}\n	</style>\n\n	<div id=\"<@portlet.namespace />carousel\">\n		<#assign imageMimeTypes = propsUtil.getArray(\"dl.file.entry.preview.image.mime.types\") />\n\n		<#list entries as entry>\n			<#if imageMimeTypes?seq_contains(entry.getMimeType())>\n				<div class=\"carousel-item image-viewer-base-image\">\n					<img alt=\"${htmlUtil.escapeAttribute(entry.getDescription())}\" src=\"${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, \"\")}\" />\n				</div>\n			</#if>\n		</#list>\n	</div>\n\n	<@liferay_aui.script use=\"aui-carousel\">\n		var carousel = new A.Carousel(\n			{\n				after: {\n					responsive: function(event) {\n						event.stopImmediatePropagation();\n\n						var boundingBox = event.currentTarget.get(\'boundingBox\');\n\n						boundingBox.all(\'.image-viewer-base-image-list, .image-viewer-base-image\').setStyles(\n							{\n								height: \'auto\',\n								maxHeight: event.height,\n								maxWidth: event.width,\n								width: \'auto\'\n							}\n						);\n					}\n				},\n\n				contentBox: \'#<@portlet.namespace />carousel\',\n				height: 250,\n				intervalTime: 2,\n				width: 700\n			}\n		).render();\n	</@liferay_aui.script>\n</#if>',0,0