an>\n						</a>\n\n						<#if showChildrenNavItems>\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									menuItem=false\n									navItem=navItem\n								/>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n\n			navigation.delegate(\n				\'focus\',\n				() => {\n					navigation.set(\'role\', \'grid\');\n				},\n				\'div\'\n			);\n\n			navigation.delegate(\n				\'blur\',\n				() => {\n					navigation.removeAttribute(\'role\');\n				},\n				\'div\'\n			);\n		}\n	</@>\n</#if>',0,0,33639,NULL,NULL),(0,0,'280516cc-1523-b6d0-31b7-86488deef664',33641,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:51.820000','2023-09-15 14:34:51.820000',33610,0,33562,'NAVIGATION-MACRO-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering i vanliga makron</Name><Name language-id=\"pt_BR\">Macros de navegação comuns</Name><Name language-id=\"ja_JP\">ナビゲーションの一般的なマクロ</Name><Name language-id=\"fr_FR\">Macros de navigation ordinaires</Name><Name language-id=\"hu_HU\">Navigáció közös makrói</Name><Name language-id=\"de_DE\">Navigation häufige Makros</Name><Name language-id=\"ca_ES\">Macros comunes de navegació</Name><Name language-id=\"ar_SA\">وحدات الماكرو الشائعة للتنقل</Name><Name language-id=\"fi_FI\">Navigoinnin yleiset makrot</Name><Name language-id=\"en_US\">Navigation common macros</Name><Name language-id=\"zh_CN\">导航常用宏</Name><Name language-id=\"es_ES\">Macros comunes de navegación</Name><Name language-id=\"nl_NL\">Algemene navigatiemacro\'s</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Innehåller vanliga makron för navigeringsmenymallar.</Description><Description language-id=\"pt_BR\">Contém macros comuns para o modelo do menu de navegação.</Description><Description language-id=\"ja_JP\">ナビゲーションメニューテンプレート用のマクロを含みます</Description><Description language-id=\"fr_FR\">Contient les macros ordinaires pour les modèles de menu de navigation.</Description><Description language-id=\"hu_HU\">A navigációs menü sablonok közös makróit tartalmazza.</Description><Description language-id=\"de_DE\">Enthält häufige Makros für Navigationsmenüvorlagen.</Description><Description language-id=\"ca_ES\">Conté macros comunes per a les plantilles del menú de navegació.</Description><Description language-id=\"ar_SA\">يحتوي على وحدات ماكرو شائعة لقوالب قائمة التنقل.</Description><Description language-id=\"fi_FI\">Sisältää yleiset navigointivalikkomallien makrot.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description><Description language-id=\"zh_CN\">包含导航菜单模板的常用宏。</Description><Description language-id=\"es_ES\">Contiene macros comunes para plantillas del menú de navegación.</Description><Description language-id=\"nl_NL\">Bevat algemene macro\'s voor navigatiemenusjablonen.</Description></root>','macro',NULL,'ftl','<#macro buildChildrenNavItems\n	displayDepth\n	navItem\n	menuItem = true\n	navItemLevel = 2\n>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n	/>\n\n	<#list navItem.getChildren() as childNavigationItem>\n		<#assign\n			nav_child_css_class = \"\"\n		/>\n\n		<#if !childNavigationItem.isChildSelected() && childNavigationItem.isSelected()>\n			<#assign\n				nav_child_css_class = \"active selected\"\n			/>\n		</#if>\n\n		<li class=\"${nav_child_css_class}\" id=\"layout_${portletDisplay.getId()}_${childNavigationItem.getLayoutId()}\" role=\"presentation\">\n			<#if childNavigationItem.isBrowsable()>\n				<#if menuItem>\n					<a class=\"dropdown-item\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n				<#else>\n					<a class=\"dropdown-item\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()}>${childNavigationItem.getName()}</a>\n				</#if>\n			<#else>\n				<span class=\"dropdown-item font-weight-semi-bold navigation-menu__submenu\">${childNavigationItem.getName()}</span>\n			</#if>\n		</li>\n\n		<#if childNavigationItem.hasBrowsableChildren() && ((displayDepth == 0) || (navItemLevel < displayDepth))>\n			<ul class=\"list-unstyled pl-3\">\n				<@buildChildrenNavItems\n					displayDepth=displayDepth\n					menuItem=false\n					navItem=childNavigationItem\n					navItemLevel=(navItemLevel + 1)\n				/>\n			</ul>\n		</#if>\n	</#list>\n</#macro>\n\n<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if !navItem.isChildSelected() && navItem.isSelected()>\n					<#assign\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\">\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,0,33642,NULL,NULL),(0,0,'4e9a89bc-6546-c4b7-cbc0-664cf70e18f6',33644,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:51.824000','2023-09-15 14:34:51.824000',33610,0,33562,'SPLIT-BUTTON-DROPDOWNS-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Nedrullningsbara listor med delningsknappar</Name><Name language-id=\"pt_BR\">Dividir menus suspensos de botão</Name><Name language-id=\"ja_JP\">スプリットボタンのドロップダウン</Name><Name language-id=\"fr_FR\">Partager les boutons du menu déroulant</Name><Name language-id=\"hu_HU\">Osztott gomb legördülő elemei</Name><Name language-id=\"de_DE\">Dropdown mit geteilten Schaltflächen</Name><Name language-id=\"ca_ES\">Desplegables de botó de divisió</Name><Name language-id=\"ar_SA\">تقسيم القوائم المنسدلة للأزرار</Name><Name language-id=\"fi_FI\">Jakopainikkeen Pudotusvalikot</Name><Name language-id=\"en_US\">Split Button Dropdowns</Name><Name language-id=\"zh_CN\">拆分按钮下拉菜单</Name><Name language-id=\"es_ES\">Desplegables de botón de expansión</Name><Name language-id=\"nl_NL\">Rolmenu met uitgesplitste knoppen</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en nedrullningsbar navigeringsmeny med rotmenyobjekt som visas som knappar.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegação suspenso com itens do menu raiz mostrados como botões.</Description><Description language-id=\"ja_JP\">ボタン形式のドロップダウンでナビゲーション メニューを表示します。</Description><Description language-id=\"fr_FR\">Affiche un menu de navigation déroulant dont les éléments sont affichés sous la forme de boutons.</Description><Description language-id=\"hu_HU\">Megjelenít egy lenyíló navigációs menüt, amelyben a gyökérszintű menüpontok gombokként jelennek meg.</Description><Description language-id=\"de_DE\">Zeigt ein Dropdown-Navigationsmenü mit Root-Menüelementen als Schaltflächen an.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació desplegable els elements de menú arrel que es mostren com a botons.</Description><Description language-id=\"ar_SA\">يعرض قائمة تنقل منسدلة تحتوي على عناصر قائمة جذر تظهر كأزرار.</Description><Description language-id=\"fi_FI\">Näyttää pudotusnavigointivalikon juurivalikon kohdat esitettynä painikkeina.</Description><Description language-id=\"en_US\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"zh_CN\">显示下拉式导航菜单，其中根菜单项显示为按钮。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación desplegable con elementos de menú raíz que se muestran como botones.</Description><Description language-id=\"nl_NL\">Geeft een rolmenu voor navigatie weer met rootmenu-items in de vorm van knoppen.</Description></root>','display',NULL,'ftl','<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul class=\"navbar-site split-button-dropdowns\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildrenNavItems = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildrenNavItems>\n					<#assign\n						nav_item_css_class = \"\"\n						nav_item_href_link = \"\"\n					/>\n\n					<#if navItem.isChildSelected() || navItem.isSelected()>\n						<#assign nav_item_css_class = \"active\" />\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\' ${navItem.getTarget()}\" />\n					</#if>\n\n					<li>\n						<#if showChildrenNavItems>\n							<#assign toggle_text>\n								<@liferay.language key=\"toggle\" />\n							</#assign>\n\n							<div class=\"btn-group\">\n						</#if>\n\n						<a class=\"${nav_item_css_class} btn btn-secondary\" ${nav_item_href_link}><span>${navItem.getName()}</span></a>\n\n						<#if showChildrenNavItems>\n							<button aria-expanded=\"false\" aria-haspopup=\"true\" class=\"${nav_item_css_class} btn btn-secondary c-px-2 dropdown-toggle\" data-toggle=\"liferay-dropdown\" type=\"button\">\n								<@liferay_aui.icon\n									image=\"angle-down\"\n									markupView=\"lexicon\"\n								/>\n\n								<span class=\'sr-only\'>${toggle_text}</span>\n							</button>\n\n							<ul aria-expanded=\"false\" class=\"child-menu dropdown-menu\" role=\"menu\">\n								<@buildChildrenNavItems\n									displayDepth=displayDepth\n									navItem=navItem\n								/>\n							</ul>\n\n							</div>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,0,33645,NULL,NULL),(0,0,'2d65183f-627d-80f7-a0b3-61c0b6e9b2f5',33648,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:52.100000','2023-09-15 14:34