qüència.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من الروابط بأحجام مختلفة تبعًا للتردد.</Description><Description language-id=\"fi_FI\">Näytä termit inline-luettelona koko vaihdellen esiintymistaajuuden mukaan.</Description><Description language-id=\"en_US\">Display terms as an inline list of links with varying sizes based on frequency.</Description><Description language-id=\"zh_CN\">将搜索词显示为大小随频率变化的内联链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces en línea con distintos tamaños basados en la frecuencia.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links van verschillende lengte op basis van frequentie.</Description></root>','display',NULL,'ftl','<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetAssetCategoriesPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${namespace + \'facetAssetCategoriesPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"category\"\n	>\n		<#if !assetCategoriesSearchFacetDisplayContext.isNothingSelected()>\n			<@clay.button\n				cssClass=\"btn-unstyled c-mb-4 facet-clear-btn\"\n				displayType=\"link\"\n				id=\"${namespace + \'facetAssetCategoriesClear\'}\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n			>\n				<strong>${languageUtil.get(locale, \"clear\")}</strong>\n			</@clay.button>\n		</#if>\n\n		<ul class=\"list-unstyled tag-cloud\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<span class=\"facet-value\">\n						<@clay.button\n							cssClass=\"btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} tag-popularity-${entry.getPopularity()} term-name\"\n							data\\-term\\-id=\"${entry.getFilterValue()}\"\n							disabled=\"true\"\n							displayType=\"link\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n							style=\"line-height: 1.2;\"\n						>\n							<#if entry.isSelected()>\n								<strong>${htmlUtil.escape(entry.getBucketText())}</strong>\n							<#else>\n								${htmlUtil.escape(entry.getBucketText())}\n							</#if>\n						</@clay.button>\n					</span>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>',0,0,33649,NULL,NULL),(0,0,'c5db0096-46c0-d4d0-af0a-c66a10ddd1d4',33651,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:52.103000','2023-09-15 14:34:52.103000',33647,0,33562,'CATEGORY-FACET-COMPACT-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezés</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposició compacta</Name><Name language-id=\"ar_SA\">مخطط مضغوط</Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\">紧凑布局</Name><Name language-id=\"es_ES\">Diseño compacto</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en lista med länkar.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista de links.</Description><Description language-id=\"ja_JP\">用語をリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste de liens.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások list