包屑导航。</Description><Description language-id=\"es_ES\">Muestra una ruta de navegación horizontalmente.</Description><Description language-id=\"nl_NL\">Geeft een broodkruimel horizontaal weer.</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<ol class=\"breadcrumb\">\n		<#list entries as entry>\n			<li class=\"breadcrumb-item\">\n				<#if entry?has_next>\n					<a\n						class=\"breadcrumb-link\"\n\n						<#if entry.isBrowsable()>\n							href=\"${htmlUtil.escapeAttribute(entry.getURL()!\"\")}\"\n						</#if>\n					>\n						<span class=\"breadcrumb-text-truncate\">${htmlUtil.escape(entry.getTitle())}</span>\n					</a>\n				<#else>\n					<span class=\"active breadcrumb-text-truncate\">${htmlUtil.escape(entry.getTitle())}</span>\n				</#if>\n			</li>\n		</#list>\n	</ol>\n</#if>',0,0,33759,NULL,NULL),(0,0,'07cccbda-66d6-d52f-826e-e0555dd06119',33761,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:52.892000','2023-09-15 14:34:52.892000',33754,0,33562,'BREADCRUMB-VERTICAL-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Vertikal</Name><Name language-id=\"pt_BR\">Vertical</Name><Name language-id=\"ja_JP\">垂直方向</Name><Name language-id=\"fr_FR\">Vertical</Name><Name language-id=\"hu_HU\">Függőleges</Name><Name language-id=\"de_DE\">Vertikal</Name><Name language-id=\"ca_ES\">Vertical</Name><Name language-id=\"ar_SA\">رأسي</Name><Name language-id=\"fi_FI\">Pystysuora</Name><Name language-id=\"en_US\">Vertical</Name><Name language-id=\"zh_CN\">垂直</Name><Name language-id=\"es_ES\">Vertical</Name><Name language-id=\"nl_NL\">Verticaal</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en länkstig vertikalt.</Description><Description language-id=\"pt_BR\">Exibe um caminho de navegação verticalmente.</Description><Description language-id=\"ja_JP\">パンくずリストをを垂直方向に表示します</Description><Description language-id=\"fr_FR\">Affiche un fil d\'Ariane vertical.</Description><Description language-id=\"hu_HU\">Megjelenít egy útkövetőjelet függőlegesen.</Description><Description language-id=\"de_DE\">Zeigt eine Breadcrumbnavigation vertikal an.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegació verticalment.</Description><Description language-id=\"ar_SA\">يعرض مسار تنقل رأسيًا.</Description><Description language-id=\"fi_FI\">Näyttää murupolun pystysuoraan.</Description><Description language-id=\"en_US\">Displays a breadcrumb vertically.</Description><Description language-id=\"zh_CN\">垂直显示面包屑导航。</Description><Description language-id=\"es_ES\">Muestra una ruta de navegación verticalmente.</Description><Description language-id=\"nl_NL\">Geeft een broodkruimel verticaal weer.</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<ul class=\"breadcrumb breadcrumb-vertical\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\" <#if entry?is_last>aria-current=\"page\"</#if>>\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				${htmlUtil.escape(entry.getTitle())}\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</ul>\n</#if>',0,0,33762,NULL,NULL),(0,0,'554279eb-aacf-69a9-7624-d13bdfa4813c',33765,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:52.983000','2023-09-15 14:34:52.983000',33764,0,33562,'RSS-NAVIGATION-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Navigering</Name><Name language-id=\"pt_BR\">Navegação</Name><Name language-id=\"ja_JP\">ナビゲーション</Name><Name language-id=\"fr_FR\">Navigation</Name><Name language-id=\"hu_HU\">Navigáció</Name><Name language-id=\"de_DE\">Navigation</Name><Name language-id=\"ca_ES\">Navegació</Name><Name language-id=\"ar_SA\">الملاحة</Name><Name language-id=\"fi_FI\">Navigointi</Name><Name language-id=\"en_US\">Navigation</Name><Name language-id=\"zh_CN\">导航</Name><Name language-id=\"es_ES\">Navegación</Name><Name language-id=\"nl_NL\">Navigatie</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar RSS-flödet som ett navigeringsfält i panelen till vänster. Om du klickar på flödet visas en lista med feedposter i panelen till höger.</Description><Description language-id=\"pt_BR\">Exibe os feeds RSS como uma barra de navegação no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id=\"ja_JP\">RSSフィードを左のパネルにナビゲーションバーとして表示します。フィードをクリックすると、右パネルにフィードの内容がリスト表示されます</Description><Description language-id=\"fr_FR\">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d\'entrées de flux sur le panneau droit.</Description><Description language-id=\"hu_HU\">Megjeleníti az RSS hírcsatornákat navigációs oszlopként a bal oldalon. Egy hírcsatornára kattintva megjeleníti a hírcsatorna bejegyzések listáját a jobb oldalon.</Description><Description language-id=\"de_DE\">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeinträge im rechten Bereich dargestellt.</Description><Description language-id=\"ca_ES\">Mostra els canals RSS com una barra de navegació en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d\'entrades en el tauler dret.</Description><Description language-id=\"ar_SA\">يعرض موجزات RSS كشريط تنقل في اللوحة اليسرى. إذ يؤدي النقر فوق موجز إلى عرض قائمة بإدخالات الموجزات على اللوحة اليمنى.</Description><Description language-id=\"fi_FI\">Näyttää RSS-syötteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla syötettä näytetään syötteen arvot oikeassa paneelissa.</Description><Description language-id=\"en_US\">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description><Description language-id=\"zh_CN\">在左侧面板上显示RSS源的导航栏。在右侧面板上点击Feed显示提要条目的列表。</Description><Description language-id=\"es_ES\">Muestra las fuentes RSS como una barra de navegación del panel izquierdo. Al hacer clic en una fuente se muestra una lista de entradas de la fuente en el panel derecho.</Description><Description language-id=\"nl_NL\">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description></root>','display',NULL,'ftl','<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div class=\"tab-pane\" id=\"tab-${curEntry_index}\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index >= (entriesPerFeed!4)?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												icon=\"calendar\"\n												label=true\n												markupView=\"lexicon\"\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>',0,0,33766,NULL,NULL),(0,0,'2420c15b-693d-de45-dbcb-dd55ec6e7b40',33768,20121,20096,20099,NULL,20099,NULL,'2023-09-15 14:34:53.020000','2023-09-15 14:34:53.020000',31202,0,33562,'WIKI-SOCIAL-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Sociala nätverk</Name><Name language-id=\"pt_BR\">Social</Name><Name language-id=\"ja_JP\">ソーシャル</Name><Name language-id=\"fr_FR\">Social</Name><Name language-id=\"hu_HU\">Közösségi</Name><Name language-id=\"de_DE\">Gemeinschaft</Name><Name language-id=\"ca_ES\">Social</Name><Name language-id=\"ar_SA\">اجتماعي</Name><Name language-id=\"fi_FI\">Sosiaalinen</Name><Name language-id=\"en_US\">Social</Name><Name language-id=\"zh_CN\">社交</Name><Name language-id=\"es_ES\">Social</Name><Name language-id=\"nl_NL\">Sociaal</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar sociala bokmärken och omdömen för wiki-sidor och deras underordnade sidor.</Description><Description language-id=\"pt_BR\">Exibe marcadores sociais e avaliações para páginas da wiki e suas páginas filhas.</Description><Description language-id=\"ja_JP\">Wikiページとそのサブページ用のソーシャルブックマークと評価を表示する</Description><Description language-id=\"fr_FR\">Affiche les signets sociaux and les notations pour page wiki et leur pages enfants.</Description><Description language-id=\"hu_HU\">Megjeleníti a közösségi könyvjelzőket és értékeléseket a wiki oldalak és gyermek oldalaik részére.</Description><Description language-id=\"de_DE\">Darstellung für Social Bookmarks und Bewertungen von Wikiseiten und deren Unterseiten.</Description><Description language-id=\"ca_ES\">Mostra adreces d\'interès socials i classificacions per a planes del wiki.</Description><Description language-id=\"ar_SA\">يعرض إشارات مرجعية اجتماعية وتقييمات لصفحات ويكي وصفحاتها الفرعية.</Description><Description language-id=\"fi_FI\">Näyttää sosiaaliset kirjanmerkit ja arvostelut wikisivuilla ja niiden alisivuilla.</Description><Description language-id=\"en_US\">Displays social bookmarks and ratings for wiki pages and their child pages.</Description><Description language-id=\"zh_CN\">显示社交书签和维基页的评分和它们的子页。</Description><Description language-id=\"es_ES\">Muestra los marcadores sociales y las clasificaciones para páginas wiki y sus páginas secundarias.</Description><Description language-id=\"nl_NL\">Geeft sociale favorieten en waarderingen van wikipagina\'s en onderliggende wikipagina\'s weer.</Description></root>','display',NULL,'ftl','<#assign\n	wikiPageClassName = \"com.liferay.wiki.model.WikiPage\"\n\n	assetRenderer = assetEntry.getAssetRenderer()\n/>\n\n<div class=\"taglib-header\">\n	<h1 class=\"header-title\">${entry.getTitle()}</h1>\n</div>\n\n<div style=\"float: right;\">\n	<@getEditIcon />\n\n	<@getPageDetailsIcon />\n\n	<@getPrintIcon />\n</div>\n\n<div class=\"wiki-body\">\n	<div class=\"wiki-info\">\n		<span class=\"stats\">${assetEntry.getViewCount()} <@liferay.language key=\"views\" /></span> |\n\n		<span class=\"date\"><@liferay.language key=\"last-modified\" /> ${dateUtil.getDate(entry.getModifiedDate(), \"dd MMM yyyy - HH:mm:ss\", locale)}</span>\n\n		<span class=\"author\"><@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(entry.getUserId(), entry.getUserName()))}</span>\n	</div>\n\n	<div class=\"wiki-content\">\n		<@liferay_social_bookmarks[\"bookmarks\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			displayStyle=\"normal\"\n			target=\"_blank\"\n			title=entry.getTitle()\n			url=viewURL\n		/>\n\n		${formattedContent}\n	</div>\n\n	<div class=\"page-actions\">\n		<div class=\"article-actions\">\n			<@getAddChildPageIcon />\n\n			<@getAttatchmentsIcon />\n		</div>\n	</div>\n\n	<br />\n\n	<@getRatings\n		cssClass=\"page-ratings\"\n		entry=entry\n	/>\n\n	<@getRelatedAssets />\n</div>\n\n<div class=\"page-categorization\">\n	<div class=\"page-categories\">\n		<#assign viewCategorizedPagesURL = renderResponse.createRenderURL() />\n\n		${viewCategorizedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_categorized_pages\")}\n		${viewCategorizedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_asset[\"asset-categories-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewCategorizedPagesURL\n		/>\n	</div>\n\n	<div class=\"page-tags\">\n		<#assign viewTaggedPagesURL = renderResponse.createRenderURL() />\n\n		${viewTaggedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_tagged_pages\")}\n		${viewTaggedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_asset[\"asset-tags-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewTaggedPagesURL\n		/>\n	</div>\n</div>\n\n<#assign childPages = entry.getChildPages() />\n\n<#if (childPages?has_content)>\n	<div class=\"child-pages\">\n		<h2><@liferay.language key=\"children-pages\" /></h2>\n\n		<table class=\"taglib-search-iterator\">\n			<tr class=\"portlet-section-header results-header\">\n				<th>\n					<@liferay.language key=\"page\" />\n				</th>\n				<th>\n					<@liferay.language key=\"last-modified\" />\n				</th>\n				<th>\n					<@liferay.language key=\"ratings\" />\n				</th>\n			</tr>\n\n			<#list childPages as childPage>\n				<tr class=\"results-row\">\n					<#assign viewPageURL = renderResponse.createRenderURL() />\n\n					${viewPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view\")}\n\n					<#assign childNode = childPage.getNode() />\n\n					${viewPageURL.setParameter(\"nodeName\", childNode.getName())}\n					${viewPageURL.setParameter(\"title\", childPage.getTitle())}\n\n					<td>\n						<a href=\"${viewPageURL}\">${childPage.getTitle()}</a>\n					</td>\n					<td>\n						<a href=\"${viewPageURL}\">${dateUtil.getDate(childPage.getModifiedDate(),\"dd MMM yyyy - HH:mm:ss\", locale)} <@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(childPage.getUserId(), childPage.getUserName()))}</a>\n					</td>\n					<td>\n						<@getRatings\n							cssClass=\"child-ratings\"\n							entry=childPage\n						/>\n					</td>\n				</tr>\n			</#list>\n		</table>\n	</div>\n</#if>\n\n<@getDiscussion />\n\n<#macro getAddChildPageIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign addPageURL = renderResponse.createRenderURL() />\n\n		${addPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${addPageURL.setParameter(\"redirect\", currentURL)}\n		${addPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${addPageURL.setParameter(\"title\", \"\")}\n		${addPageURL.setParameter(\"editTitle\", \"1\")}\n		${addPageURL.setParameter(\"parentTitle\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			icon=\"plus\"\n			label=true\n			markupView=\"lexicon\"\n			message=\"add-child-page\"\n			url=addPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getAttatchmentsIcon>\n	<#assign viewPageAttachmentsURL = renderResponse.createRenderURL() />\n\n	${viewPageAttachmentsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_attachments\") }\n\n	<@liferay_ui[\"icon\"]\n		icon=\"paperclip\"\n		label=true\n		markupView=\"lexicon\"\n		message=\'${entry.getAttachmentsFileEntriesCount() + languageUtil.get(locale, \"attachments\")}\'\n		url=viewPageAttachmentsURL?string\n	/>\n</#macro>\n\n<#macro getDiscussion>\n	<#if validator.isNotNull(assetRenderer.getDiscussionPath()) && wikiPortletInstanceConfiguration.enableComments()>\n		<br />\n\n		<@liferay_comment[\"discussion\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			ratingsEnabled=wikiPortletInstanceConfiguration.enableCommentRatings()\n			redirect=currentURL\n			subject=assetRenderer.getTitle(locale)\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign\n			editPageURL = renderResponse.createRenderURL()\n			title = languageUtil.format(locale, \"edit-x\", entry.getTitle(), false)\n		/>\n\n		${editPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${editPageURL.setParameter(\"redirect\", currentURL)}\n		${editPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${editPageURL.setParameter(\"title\", entry.getTitle())}\n\n		<span aria-label=\"${title}\">\n			<@clay[\"link\"]\n				borderless=true\n				cssClass=\"lfr-portal-tooltip\"\n				displayType=\"secondary\"\n				href=editPageURL?string\n				icon=\"pencil\"\n				monospaced=true\n				small=true\n				title=title\n			/>\n		</span>\n	</#if>\n</#macro>\n\n<#macro getPageDetailsIcon>\n	<#assign\n		title = languageUtil.get(locale, \"details\")\n		viewPageDetailsURL = renderResponse.createRenderURL()\n	/>\n\n	${viewPageDetailsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_details\")}\n	${viewPageDetailsURL.setParameter(\"redirect\", currentURL)}\n\n	<span aria-label=\"${title}\">\n		<@clay[\"link\"]\n			borderless=true\n			cssClass=\"lfr-portal-tooltip\"\n			displayType=\"secondary\"\n			href=viewPageDetailsURL?string\n			icon=\"document\"\n			monospaced=true\n			small=true\n			title=title\n		/>\n	</span>\n</#macro>\n\n<#macro getPrintIcon>\n	<#assign printURL = renderResponse.createRenderURL() />\n\n	${printURL.setParameter(\"viewMode\", \"print\")}\n	${printURL.setWindowState(\"pop_up\")}\n\n	<#assign\n		title = languageUtil.format(locale, \"print-x\", htmlUtil.escape(assetRenderer.getTitle(locale)), false)\n	/>\n\n	<span aria-label=\"${title}\">\n		<@clay[\"button\"]\n			borderless=true\n			cssClass=\"lfr-portal-tooltip\"\n			displayType=\"secondary\"\n			icon=\"print\"\n			monospaced=true\n			onClick=\"javascript:Liferay.Util.openWindow({dialog: {width: 960}, id:\'\" + renderResponse.getNamespace() + \"printAsset\', title: \'\" + title + \"\', uri: \'\" + printURL.toString() + \"\'});\"\n			small=true\n			title=\"${title}\"\n		/>\n	</span>\n</#macro>\n\n<#macro getRatings\n	cssClass\n	entry\n>\n	<#if wikiPortletInstanceConfiguration.enablePageRatings()>\n		<div class=\"${cssClass}\">\n			<@liferay_ratings[\"ratings\"]\n				className=wikiPageClassName\n				classPK=entry.getResourcePrimKey()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if assetEntry?? && wikiPortletInstanceConfiguration.enableRelatedAssets()>\n		<@liferay_asset[\"asset-links\"] assetEntryId=assetEnt