commerceCartContentMiniDisplayContext.getCPDefinitionURL(cpDefinition.getCPDefinitionId(), themeDisplay)\n\n				name = cpDefinition.getName(themeDisplay.getLanguageId())\n			/>\n\n			<#if commerceCartContentMiniDisplayContext.getCommerceOrderItemThumbnailSrc(curCommerceOrderItem)??>\n				<#assign\n					image = commerceCartContentMiniDisplayContext.getCommerceOrderItemThumbnailSrc(curCommerceOrderItem)\n				/>\n			</#if>\n\n			<div class=\"col-md-6\">\n				<div class=\"row-fluid\">\n					<img class=\"w-100\" src=\"${htmlUtil.escapeAttribute(image)}\">\n				</div>\n\n				<div class=\"row-fluid\">\n					<a href=\"${htmlUtil.escapeAttribute(productURL)}\">\n						<strong>${htmlUtil.escape(name)}</strong>\n					</a>\n\n					<div class=\"commerce-price-section d-inline float-right\">\n						<@commerce_ui[\"price\"]\n							CPDefinitionId=cpDefinition.getCPDefinitionId()\n							CPInstanceId=curCommerceOrderItem.getCPInstanceId()\n							showDiscount=false\n						/>\n					</div>\n				</div>\n			</div>\n\n			<#assign count = count + 1 />\n\n			<#if count gte 2>\n				</div>\n\n				<div class=\"row\">\n\n				<#assign count = 0 />\n			</#if>\n		</#list>\n	</div>\n</#if>',0,20099,NULL,'2023-09-15 14:34:51.281000'),(0,0,33569,20121,20096,20099,NULL,'2023-09-15 14:34:51.321000',33566,0,33567,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Standard</Name><Name language-id=\"pt_BR\">Básico</Name><Name language-id=\"ja_JP\">通常の検索に戻る</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"hu_HU\">Egyszerű</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"ca_ES\">Bàsic</Name><Name language-id=\"ar_SA\">أساسي</Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"en_US\">Basic</Name><Name language-id=\"zh_CN\">基本的</Name><Name language-id=\"es_ES\">Básico</Name><Name language-id=\"nl_NL\">