>Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>','ftl','<#assign count = 0 />\n\n<div class=\"container-fluid container-fluid-max-xl\" style=\"text-align:center\">\n	<div class=\"row\" style=\"padding:15px\">\n		<#if entries?has_content>\n			<#list entries as curCommerceAddress>\n				<div class=\"col-md-4\" style=\"text-align:left\">\n					<#assign\n						editURL = commerceAddressDisplayContext.getEditCommerceAddressURL(curCommerceAddress.getCommerceAddressId())\n\n						deleteURL = commerceAddressDisplayContext.getDeleteCommerceAddressURL(curCommerceAddress.getCommerceAddressId())\n\n						editButtonValue = languageUtil.get(request, \"edit\")\n\n						removeButtonValue = languageUtil.get(request, \"remove\")\n\n						commerceCountry = curCommerceAddress.getCommerceCountry()\n					/>\n\n					<h2 style=\"color:#000\"><strong>${htmlUtil.escape(curCommerceAddress.getName())}</strong></h2>\n\n					<h3 style=\"color:#000\">${htmlUtil.escape(curCommerceAddress.getStreet1())}</h3>\n\n					<h3 style=\"color:#000\">${htmlUtil.escape(curCommerceAddress.getZip())}, ${htmlUtil.escape(curCommerceAddress.getCity())}</h3>\n\n					<#if commerceCountry??>\n						<h3 style=\"color:#000\">${htmlUtil.escape(commerceCountry.getName(themeDisplay.getLanguageId()))}</h3>\n					</#if>\n\n					<div class=\"row\" style=\"padding-top:30px\">\n						<@liferay_aui.button\n							cssClass=\"btn-lg\"\n							href=\"${editURL}\"\n							name=\"editAddressButton\"\n							value=\"${editButtonValue}\"\n						/>\n\n						<@liferay_aui.button\n							cssClass=\"btn-lg\"\n							href=\"${deleteURL}\"\n							name=\"removeAddressButton\"\n							value=\"${removeButtonValue}\"\n						/>\n					</div>\n				</div>\n\n				<#assign count = count + 1 />\n\n				<#if count gte 3>\n					</div>\n\n					<div class=\"row\" style=\"padding:15px\">\n\n					<#assign count = 0 />\n				</#if>\n			</#list>\n		</#if>\n	</div>\n\n	<div class=\"row\" style=\"padding:50px 0 15px 0\">\n		<#assign addButtonValue = languageUtil.get(request, \"add-address\") />\n\n		<@liferay_aui.button\n			cssClass=\"btn-lg btn-primary\"\n			href=\"${commerceAddressDisplayContext.getAddCommerceAddressURL()}\"\n			name=\"addAddressButton\"\n			value=\"${addButtonValue}\"\n		/>\n	</div>\n</div>',0,20099,NULL,'2023-09-15 14:34:51.384000'),(0,0,33580,20121,20096,20099,NULL,'2023-09-15 14:34:51.423000',20037,0,33578,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">تخطيط أعمدة متعددة</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn för varje sida på den högsta nivån. Varje kolumn inkluderar namnet på varje sida på den högsta nivån samt sidans omedelbara underordnade element listade under den.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada página de nível superior. Cada coluna inclui o nome de uma página de nível superior com os filhos imediatos da página listados abaixo.</Description><Description language-id=\"ja_JP\">最上位のページごとに列を表示します。各列には、トップレベルのページの名前と、直下のサブページのページ名を含みます。</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page de niveau supérieur. Chaque colonne comprend le nom d\'une page de niveau supérieur avec les enfants immédiats indiqués en-dessous.</Description><Description language-id=\"hu_HU\">Megjelenít egy oszlopot minden felső szintű oldalhoz. Mindegyik oszlop tartalmazza a legfelső szintű oldal nevét, alatta az oldal közvetlen utódjával.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte für jede Seite der obersten Ebene. Jede Spalte enthält den Namen einer Seite der obersten Ebene, darunter werden die direkten Unterseiten aufgelistet.</Description><Description language-id=\"ca_ES\">Mostra una columna per cada pàgina de nivell superior. A cada columna, s\'hi inclou el nom d\'una pàgina de nivell superior amb el fill immediat de la pàgina en una llista a la part inferior.</Description><Description language-id=\"ar_SA\">يعرض عمودًا لكل صفحة مستوى أعلى. يتضمن كل عمود اسم صفحة المستوى العلوي بفروع متوسطة للصفحة مدرجة أسفلها.</Description><Description language-id=\"fi_FI\">Näyttää sarakkeen jokaiselle ylätason sivulle. Jokainen sarake sisältää ylätason sivun nimen ja sivun välittömät alasivut lueteltuna alapuolella.</Description><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description><Description language-id=\"zh_CN\">为每个顶级页面显示一列。每一列都包含顶级页面的名称以及页面下所列的直接子级。</Description><Description language-id=\"es_ES\">Muestra una columna por cada página de nivel superior. En cada columna, se incluye el nombre de una página de nivel superior con el elemento secundario inmediato de la página en una lista de la parte inferior.</Description><Description language-id=\"nl_NL\">Geeft een kolom weer voor elke pagina op het hoogste niveau. Elke kolom bevat de naam van een bovenliggende pagina met alle directe onderliggende pagina\'s eronder.</Description></root>','ftl','<#if entries?has_content>\n	<@clay.row>\n		<#list entries as entry>\n			<#if (getterUtil.getBoolean(showHiddenPages) || !entry.isHidden()) && layoutPermission.containsWithoutViewableGroup(permissionChecker, entry, \"VIEW\")>\n				<@clay.col md=\"3\">\n					<div class=\"results-header\">\n						<h3>\n							<a\n\n							<#assign layoutType = entry.getLayoutType() />\n\n							<#if layoutType.isBrowsable()>\n								href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n							</#if>\n\n							>${entry.getName(locale)}</a>\n						</h3>\n					</div>\n\n					<@displayPages\n						depth=1\n						pages=entry.getChildren(permissionChecker)\n					/>\n				</@clay.col>\n			</#if>\n		</#list>\n	</@clay.row>\n</#if>\n\n<#macro displayPages\n	depth\n	pages\n>\n	<#if pages?has_content && ((depth < displayDepth?number) || (displayDepth?number == 0))>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<#if getterUtil.getBoolean(showHiddenPages) || !page.isHidden()>\n					<li>\n						<a\n\n						<#assign pageType = page.getLayoutType() />\n\n						<#if pageType.isBrowsable()>\n							href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n						</#if>\n\n						>${page.getName(locale)}</a>\n\n						<@displayPages\n							depth=depth + 1\n							pages=page.getChildren(permissionChecker)\n						/>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20099,NULL,'2023-09-15 14:34:51.423000'),(0,0,33583,20121,20096,20099,NULL,'2023-09-15 14:34:51.475000',20004,0,33581,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout med flera kolumner</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"ar_SA\">تخطيط أعمدة متعددة</Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar en kolumn för varje ordlista. Varje kolumn inkluderar namnet på en ordlista med ordlistans toppnivåkategorier listade under.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulário. Cada coluna inclui o nome do vocabulário com as categorias de nível mais alto listadas abaixo dele.</Description><Description language-id=\"ja_JP\">各ボキャブラリ用に列を表示する。各列は以下にリストになっている、最上位に設定されている用語名を含んでいます</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d\'un vocabulaire avec les catégories du niveau racine listées en dessous.</Description><Description language-id=\"hu_HU\">Megjelenít egy oszlopot minden szótár számára. Minden oszlop tartalmazza a szótár nevét, alatta a szótár felső szintű kategóriáival.</Description><Description language-id=\"de_DE\">Stellt eine Spalte für jedes Vokabular dar. Jede Spalte enthält den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id=\"ca_ES\">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell més alta a sota.</Description><Description language-id=\"ar_SA\">يعرض عمودًا لكل مفرد. يتضمن كل عمود اسم المفرد مع فئات المستوى الأعلى للمفردات المدرجة تحتها.</Description><Description language-id=\"fi_FI\">Näyttää sarakkeen jokaiselle sanastolle. Jokainen sarake sisältää sanaston nimen, missä sanaston ylätason luokitukset on listattu.</Description><Description language-id=\"en_US\">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary\'s top level categories listed underneath.</Description><Description language-id=\"zh_CN\">显示一列中的每个词汇，每列包括顶级类别之下的词汇名字。</Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categorías de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"nl_NL\">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorieën eronder.</Description></root>','ftl','<#assign hasCategories = false />\n\n<#if entries?has_content>\n	<@clay.row>\n		<#list entries as entry>\n			<#assign categories = entry.getCategories() />\n\n			<#if categories?has_content>\n				<#assign hasCategories = true />\n\n				<@clay.col md=\"3\">\n					<div class=\"results-header\">\n						<h3>\n							${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n						</h3>\n					</div>\n\n					<@displayCategories categories=categories />\n				</@clay.col>\n			</#if>\n		</#list>\n\n		<#if !hasCategories>\n			${renderRequest.setAttribute(\"PORTLET_CONFIGURATOR_VISIBILITY\", true)}\n\n			<div class=\"alert alert-info w-100\">\n				<@liferay_ui.message key=\"there-are-no-categories\" />\n			</div>\n		</#if>\n	</@clay.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20099,NULL,'2023-09-15 14:34:51.475000'),(0,0,33587,20121,20096,20099,NULL,'2023-09-15 14:34:51.509000',33584,0,33585,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Ikon</Name><Name language-id=\"pt_BR\">Ícone</Name><Name language-id=\"ja_JP\">アイコン</Name><Name language-id=\"fr_FR\">Icône</Name><Name language-id=\"hu_HU\">Ikon</Name><Name language-id=\"de_DE\">Symbol</Name><Name language-id=\"ca_ES\">Icona</Name><Name language-id=\"ar_SA\">أيقونة</Name><Name language-id=\"fi_FI\">Kuvake</Name><Name language-id=\"en_US\">Icon</Name><Name language-id=\"zh_CN\">图标</Name><Name language-id=\"es_ES\">Icono</Name><Name language-id=\"nl_NL\">Pictogram</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visar ikonen på flaggan som är associerad med varje språk.</Description><Description language-id=\"pt_BR\">Exibe o ícone do marcador associado com cada idioma.</Description><Description language-id=\"ja_JP\">各言語に関連付けられたフラグのアイコンを表示します</Description><Description language-id=\"fr_FR\">Affiche l\'icône de chaque option associé à chaque langue.</Description><Description language-id=\"hu_HU\">Megjeleníti az egyes nyelvekhez társított zászlót tartalmazó ikont.</Description><Description language-id=\"de_DE\">Zeigt das Symbol der Flagge für jede Sprache an.</Description><Description language-id=\"ca_ES\">Mostra la icona de la bandera associada a cada idioma.</Description><Description language-id=\"ar_SA\">يعرض أيقونة العلم المرتبط بكل لغة.</Description><Description language-id=\"fi_FI\">Näyttä kuhunkin kieleen liittyvän lippukuvakkeen.</Description><Description language-id=\"en_US\">Displays the icon of the flag associated with each language.</Description><Description language-id=\"zh_CN\">显示与每种语言关联的国旗的图标。</Description><Description language-id=\"es_ES\">Muestra el icono de la bandera asociada con cada idioma.</Description><Description language-id=\"nl_NL\">Geeft het pictogram weer van de vlag die bij elke taal hoort.</Description></root>','ftl','<#if entries?has_content>\n	<#list entries as entry>\n		<#if entry.isSelected()>\n			<#assign cssClass = \"current-language\" />\n		</#if>\n\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"icon\"]\n				ariaLabel=entry.getLongDisplayName()\n				cssClass=cssClass\n				image=entry.getW3cLanguageId()?lower_case\n				markupView=\"lexicon\"\n				message=entry.getLongDisplayName()\n				url=entry.getURL()\n			/>\n		</#if>\n	</#list>\n</#if>',0,20099,NULL,'2023-09-15 14:34:51.509000'),(0,0,33590,20121,20096,20099,NULL