llapsible=true\n		cssClass=\"search-facet search-facet-display-label\"\n		id=\"${namespace + \'facetAssetCategoriesPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"category\"\n	>\n		<#if !assetCategoriesSearchFacetDisplayContext.isNothingSelected()>\n			<@clay.button\n				cssClass=\"btn-unstyled c-mb-4 facet-clear-btn\"\n				displayType=\"link\"\n				id=\"${namespace + \'facetAssetCategoriesClear\'}\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n			>\n				<strong>${languageUtil.get(locale, \"clear\")}</strong>\n			</@clay.button>\n		</#if>\n\n		<#if entries?has_content>\n			<div class=\"label-container\">\n				<#list entries as entry>\n					<@clay.button\n						cssClass=\"label label-lg facet-term ${(entry.isSelected())?then(\'label-primary facet-term-selected\', \'label-secondary facet-term-unselected\')} term-name\"\n						data\\-term\\-id=\"${entry.getFilterValue()}\"\n						disabled=\"true\"\n						displayType=\"unstyled\"\n						onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n					>\n						<span class=\"label-item label-item-expand\">\n							${htmlUtil.escape(entry.getBucketText())}\n\n							<#if entry.isFrequencyVisible()>\n								(${entry.getFrequency()})\n							</#if>\n						</span>\n					</@clay.button>\n				</#list>\n			</div>\n		</#if>\n	</@>\n</@>',0,20099,NULL,'2023-09-15 14:34:52.107000'),(0,0,33659,20121,20096,20099,NULL,'2023-09-15 14:34:52.113000',33647,0,33657,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Layout för ordlista</Name><Name language-id=\"pt_BR\">Layout do vocabulário</Name><Name language-id=\"ja_JP\">ボキャブラリレイアウト</Name><Name language-id=\"fr_FR\">Disposition du vocabulaire</Name><Name language-id=\"hu_HU\">Szótár elrendezés</Name><Name language-id=\"de_DE\">Vokabularlayout</Name><Name language-id=\"ca_ES\">Disposició del vocabulari</Name><Name language-id=\"ar_SA\">مخطط المفردات</Name><Name language-id=\"fi_FI\">Sanaston asettelu</Name><Name language-id=\"en_US\">Vocabulary Layout</Name><Name language-id=\"zh_CN\">词汇布局</Name><Name language-id=\"es_ES\">Diseño de vocabulario</Name><Name language-id=\"nl_NL\">Indeling woordenlijst</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa kategorier efter ordlista.</Description><Description language-id=\"pt_BR\">Exibir categorias por vocabulários.</Description><Description language-id=\"ja_JP\">ボキャブラリごとにカテゴリを表示します。</Description><Description language-id=\"fr_FR\">Afficher les catégories par vocabulaire.</Description><Description language-id=\"hu_HU\">Kategóriák megjelenítése a szótárban.</Description><Description language-id=\"de_DE\">Kategorien nach Vokabular anzeigen.</Description><Description language-id=\"ca_ES\">Mostra les categories per vocabulari.</Description><Description language-id=\"ar_SA\">عرض الفئات حسب المفردات.</Description><Description language-id=\"fi_FI\">Näyttöluokat sanaston mukaan.</Description><Description language-id=\"en_US\">Display categories by vocabulary.</Description><Description language-id=\"zh_CN\">按词汇显示类别。</Description><Description language-id=\"es_ES\">Muestra las categorías por vocabulario.</Description><Description language-id=\"nl_NL\">Categorieën weergeven volgens woordenlijst.</Description></root>','ftl','<#macro treeview_item\n	cssClassTreeItem = \"\"\n	frequency = 0\n	id = \"\"\n	frequencyVisible = true\n	name = \"\"\n	selectable = false\n	selected = false\n	termDisplayContexts = \"\"\n>\n	<li class=\"treeview-item\" role=\"none\">\n		<#if name?has_content>\n			<div\n				aria-controls=\"${namespace}treeItem${id}\"\n				aria-expanded=\"true\"\n				class=\"treeview-link ${cssClassTreeItem}\"\n				data-target=\"#${namespace}treeItem${id}\"\n				data-toggle=\"collapse\"\n				onClick=\"${namespace}toggleTreeItem(\'${namespace}treeItem${id}\');\"\n				role=\"treeitem\"\n				tabindex=\"0\"\n			>\n				<span class=\"c-inner\" tabindex=\"-2\">\n					<span class=\"autofit-row\">\n						<#if termDisplayContexts?has_content>\n							<span class=\"autofit-col\">\n								<@clay.button\n									aria\\-controls=\"${namespace}treeItem${id}\"\n									aria\\-expanded=\"true\"\n									cssClass=\"btn btn-monospaced component-expander\"\n									data\\-target=\"#${namespace}treeItem${id}\"\n									data\\-toggle=\"collapse\"\n									displayType=\"link\"\n									tabindex=\"-1\"\n								>\n									<span class=\"c-inner\" tabindex=\"-2\">\n										<@clay[\"icon\"] symbol=\"angle-down\" />\n\n										<@clay[\"icon\"]\n											cssClass=\"component-expanded-d-none\"\n											symbol=\"angle-right\"\n										/>\n									</span>\n								</@clay.button>\n							</span>\n						</#if>\n\n						<#if selectable>\n							<span class=\"autofit-col autofit-col-expand\">\n								<div class=\"custom-checkbox custom-control\">\n									<label>\n										<input\n											autocomplete=\"off\"\n											${selected?then(\"checked\", \"\")}\n											class=\"custom-control-input facet-term\"\n											data-term-id=${id}\n											disabled\n											onChange=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n											type=\"checkbox\"\n										/>\n\n										<span class=\"custom-control-label\">\n											<span class=\"custom-control-label-text\">\n												${name}\n\n												<#if frequencyVisible>\n													(${frequency})\n												</#if>\n											</span>\n										</span>\n									</label>\n								</div>\n							</span>\n						<#else>\n							<span class=\"autofit-col autofit-col-expand\">\n								<span class=\"component-text\">\n									<span\n										class=\"text-truncate-inline\"\n										title=\"${name}\"\n									>\n										<span class=\"text-truncate\">\n											${name}\n\n											<#if frequencyVisible>\n												(${frequency})\n											</#if>\n										</span>\n									</span>\n								</span>\n							</span>\n						</#if>\n					</span>\n				</span>\n			</div>\n		</#if>\n\n		<#if termDisplayContexts?has_content>\n			<div class=\"collapse show\" id=\"${namespace}treeItem${id}\">\n				<ul class=\"treeview-group\" role=\"group\">\n					<#list termDisplayContexts as termDisplayContext>\n						<@treeview_item\n							cssClassTreeItem=\"tree-item-category\"\n							frequency=termDisplayContext.getFrequency()\n							frequencyVisible=termDisplayContext.isFrequencyVisible()\n							id=termDisplayContext.getFilterValue()\n							name=htmlUtil.escape(termDisplayContext.getBucketText())\n							selectable=true\n							selected=termDisplayContext.isSelected()\n						/>\n					</#list>\n				</ul>\n			</div>\n		</#if>\n	</li>\n</#macro>\n\n<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${namespace + \'facetAssetCategoriesPanelContainer\'}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<#assign vocabularyNames = assetCategoriesSearchFacetDisplayContext.getVocabularyNames() />\n\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet search-facet-display-vocabulary\"\n		id=\"${namespace + \'facetAssetCategoriesPanel\'}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${(vocabularyNames?size == 1)?then(vocabularyNames[0]!\'\', \'category\')}\"\n	>\n		<#if !assetCategoriesSearchFacetDisplayContext.isNothingSelected()>\n			<@clay.button\n				cssClass=\"btn-unstyled c-mb-4 facet-clear-btn\"\n				displayType=\"link\"\n				id=\"${namespace + \'facetAssetCategoriesClear\'}\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n			>\n				<strong>${languageUtil.get(locale, \"clear\")}</strong>\n			</@clay.button>\n		</#if>\n\n		<#if vocabularyNames?has_content>\n			<ul class=\"treeview treeview-light treeview-nested treeview-vocabulary-display\" role=\"tree\">\n				<#list vocabularyNames as vocabularyName>\n					<@treeview_item\n						cssClassTreeItem=\"tree-item-vocabulary\"\n						frequencyVisible=false\n						id=vocabularyName + vocabularyName?index\n						name=\"${(vocabularyNames?size == 1)?then(\'\', htmlUtil.escape(vocabularyName))}\"\n						termDisplayContexts=assetCategoriesSearchFacetDisplayContext.getBucketDisplayContexts(vocabularyName)\n					/>\n				</#list>\n			</ul>\n		</#if>\n	</@>\n</@>\n\n<@liferay_aui.script>\n	function ${namespace}toggleTreeItem(dataTarget) {\n		const dataTargetElements = document.querySelectorAll(\"[data-target=\\\"#\" + dataTarget + \"\\\"]\");\n\n		dataTargetElements.forEach(\n			element => {\n				if (element.classList.contains(\'collapsed\')) {\n					element.classList.remove(\'collapsed\');\n					element.setAttribute(\'aria-expanded\', true);\n				}\n				else {\n					element.classList.add(\'collapsed\');\n					element.setAttribute(\'aria-expanded\', false);\n				}\n			}\n		);\n\n		const subtreeCategoryTreeElement = document.getElementById(dataTarget);\n\n		if (subtreeCategoryTreeElement) {\n			if (subtreeCategoryTreeElement.classList.contains(\'show\')) {\n				subtreeCategoryTreeElement.classList.remove(\'show\');\n			}\n			else {\n				subtreeCategoryTreeElement.classList.add(\'show\');\n			}\n		}\n	}\n</@>',0,20099,NULL,'2023-09-15 14:34:52.113000'),(0,0,33663,20121,20096,20099,NULL,'2023-09-15 14:34:52.195000',33660,0,33661,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezés</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposició compacta</Name><Name language-id=\"ar_SA\">مخطط مض