t enkel hun titel.</Description></root>','ftl','<div class=\"c-mb-4 c-mt-4 search-total-label\">\n	<#if searchContainer.getTotal() == 1>\n		${languageUtil.format(locale, \"x-result-for-x\", [searchContainer.getTotal(), \"<strong>\" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + \"</strong>\"], false)}\n	<#else>\n		${languageUtil.format(locale, \"x-results-for-x\", [searchContainer.getTotal(), \"<strong>\" + htmlUtil.escape(searchResultsPortletDisplayContext.getKeywords()) + \"</strong>\"], false)}\n	</#if>\n</div>\n\n<div class=\"display-compact\">\n	<ul class=\"list-unstyled\">\n		<#if entries?has_content>\n			<#list entries as entry>\n				<li class=\"c-mb-3 c-mt-3\">\n					<a class=\"link-primary single-link\" href=\"${entry.getViewURL()}\">\n						${entry.getHighlightedTitle()}\n					</a>\n				</li>\n			</#list>\n		</#if>\n	</ul>\n</div>',0,20099,NULL,'2023-09-15 14:34:52.382000'),(0,0,33691,20121,20096,20099,NULL,'2023-09-15 14:34:52.387000',33685,0,33689,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Listlayout</Name><Name language-id=\"pt_BR\">Layout da lista</Name><Name language-id=\"ja_JP\">リストレイアウト</Name><Name language-id=\"fr_FR\">Disposition en liste</Name><Name language-id=\"hu_HU\">Lista elrendezés</Name><Name language-id=\"de_DE\">Listenlayout</Name><Name language-id=\"ca_ES\">Disposició de la llista</Name><Name language-id=\"ar_SA\">مخطط القائمة</Name><Name language-id=\"fi_FI\">Luetteloasettelu</Name><Name language-id=\"en_US\">List Layout</Name><Name language-id=\"zh_CN\">列表布局</Name><Name language-id=\"es_ES\">Diseño de lista</Name><Name language-id=\"nl_NL\">Lijstlay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Descriptio