row\">\n								<div class=\"autofit-col autofit-col-expand\">\n									<section class=\"autofit-section\">\n										<h3 class=\"card-title\">\n											<a href=\"${entry.getViewURL()}\">\n												${entry.getHighlightedTitle()}\n											</a>\n										</h3>\n\n										<#if entry.isCreatorVisible()>\n											<p class=\"card-subtitle text-2\">\n												<span class=\"text-truncate-inline\">\n													<span class=\"text-truncate\">\n														${htmlUtil.escape(entry.getCreatorUserName())}\n													</span>\n												</span>\n											</p>\n										</#if>\n\n										<#if entry.isCreationDateVisible()>\n											<p class=\"card-subtitle text-2\">\n												<span class=\"text-truncate-inline\">\n													<span class=\"text-truncate\">\n														${entry.getCreationDateString()}\n													</span>\n												</span>\n											</p>\n										</#if>\n\n										<#if entry.isModelResourceVisible()>\n											<p class=\"card-subtitle text-2\">\n												<span class=\"text-truncate-inline\">\n													<span class=\"text-truncate\">\n														${entry.getModelResource()}\n													</span>\n												</span>\n											</p>\n										</#if>\n\n										<#if entry.isContentVisible()>\n											<p class=\"c-mt-1 card-description text-2\">\n												${entry.getContent()}\n											</p>\n										</#if>\n									</section>\n								</div>\n							</div>\n						</div>\n					</div>\n				</li>\n			</#list>\n		</#if>\n	</ul>\n</div>',0,20099,NULL,'2023-09-15 14:34:52.394000'),(0,0,33698,20121,20096,20099,NULL,'2023-09-15 14:34:52.458000',33695,0,33696,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR