ot available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa rubriker, författare och sammanfattningar kompakt för blogginlägg.</Description><Description language-id=\"pt_BR\">Exibe títulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"ja_JP\">タイトル、作成者、要約は、ブログエントリー用に小さくまとめられます</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manière compacte pour les entrées de blog.</Description><Description language-id=\"hu_HU\">Megjeleníti kompakt módon a címeket, szerzőket és kivonatokat a blog bejegyzésekhez.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen für Blogeinträge.</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"ar_SA\">يعرض العناوين والمؤلفين والملخصات لإدخالات المدونات بشكل مضغوط.</Description><Description language-id=\"fi_FI\">Näyttää blogien otsikot, tekijät ja lyhenteet lyhyesti</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description><Description language-id=\"zh_CN\">简介显示博客的名字，作者和摘要。</Description><Description language-id=\"es_ES\">Muestra de forma compacta títulos, autores y resúmenes para las entradas del blog.</Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description></root>','ftl','<#assign count = 0\n/>\n\n<#if entries?has_content>\n	<div class=\"row\">\n		<#list entries as curCPCatalogEntry>\n			<#assign\n				image = curCPCatalogEntry.getDefaultImageFileUrl()\n\n				friendlyURL = cpContentHelper.getFriendlyURL(curCPCatalogEntry, themeDisplay)\n\n				name = curCPCatalogEntry.getName()\n			/>\n\n			<div class=\"col-md-4\">\n				<div>\n					<img src=\"${htmlUtil.escapeAttribute(image)}\">\n				</div>\n\n				<div>\n					<a href=\"${htmlUtil.escapeHREF(friendlyURL)}\">\n						<strong>${htmlUtil.escape(name)}</strong>\n					</a>\n				</div>\n			</div>\n\n			<#assign count = count + 1 />\n\n			<#if count gte 3>\n				</div>\n\n				<div class=\"row\">\n\n				<#assign count = 0 />\n			</#if>\n		</#list>\n	</div>\n<#else>\n	<div class=\"alert alert-info\">\n		<@liferay_ui[\"message\"] key=\"no-products-were-found\" />\n	</div>\n</#if>',0,20099,NULL,'2023-09-15 14:34:52.795000'),(0,0,33747,20121,20096,20099,NULL,'2023-09-15 14:34:52.825000',33744,0,33745,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Cloud-layout</Name><Name language-id=\"pt_BR\">Layout de nuvem</Name><Name language-id=\"ja_JP\">クラウドのレイアウト</Name><Name language-id=\"fr_FR\">Disposition du cloud</Name><Name language-id=\"hu_HU\">Felhő elrendezés</Name><Name language-id=\"de_DE\">Cloudlayout</Name><Name language-id=\"ca_ES\">Disposició del núvol</Name><Name language-id=\"ar_SA\">مخطط السحابة</Name><Name language-id=\"fi_FI\">Pilviasettelu</Name><Name language-id=\"en_US\">Cloud Layout</Name><Name language-id=\"zh_CN\">云布局</Name><Name language-id=\"es_ES\">Diseño de nube</Name><Name language-id=\"nl_NL\">Cloudlay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en infogad lista med länkar med olika storlekar baserat på frekvens.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista embutida de links com tamanhos variados baseados pela frequência.</Description><Description language-id=\"ja_JP\">用語を頻度に応じてサイズが変わるインライン形式のリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme d\'une liste intégrée de liens dont les tailles varient en fonction des fréquences.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseket hivatkozások sorközi listájaként a gyakoriságtól függően változó méretben.</Description><Description language-id=\"de_DE\">Begriffe als eingebettete Linkliste mit unterschiedlichen Größen auf Basis der Häufigkeit anzeigen.</Description><Description language-id=\"ca_ES\">Mostra els termes com una llista integrada d\'enllaços amb diverses mides basats en la freqüència.</Description><Description language-id=\"ar_SA\">عرض المصطلحات كقائمة مدمجة من الروابط بأحجام مختلفة تبعًا للتردد.</Description><Description language-id=\"fi_FI\">Näytä termit inline-luettelona koko vaihdellen esiintymistaajuuden mukaan.</Description><Description language-id=\"en_US\">Display terms as an inline list of links with varying sizes based on frequency.</Description><Description language-id=\"zh_CN\">将搜索词显示为大小随频率变化的内联链接列表。</Description><Description language-id=\"es_ES\">Muestra términos como una lista de enlaces en línea con distintos tamaños basados en la frecuencia.</Description><Description language-id=\"nl_NL\">Termen weergeven als een gealigneerde lijst met links van verschillende lengte op basis van frequentie.</Description></root>','ftl','<@liferay_ui[\"panel-container\"]\n	extended=true\n	id=\"${panelContainerId}\"\n	markupView=\"lexicon\"\n	persistState=true\n>\n	<@liferay_ui.panel\n		collapsible=true\n		cssClass=\"search-facet\"\n		id=\"${panelId}\"\n		markupView=\"lexicon\"\n		persistState=true\n		title=\"${panelTitle}\"\n	>\n		<#if cpSpecificationOptionsSearchFacetDisplayContext.isShowClear()>\n			<@liferay_aui.button\n				cssClass=\"btn-link btn-unstyled facet-clear-btn\"\n				onClick=\"Liferay.Search.FacetUtil.clearSelections(event);\"\n				value=\"clear\"\n			/>\n		</#if>\n\n		<ul class=\"list-unstyled tag-cloud\">\n			<#if entries?has_content>\n				<#list entries as entry>\n					<span class=\"facet-value\">\n						<button\n							class=\"btn btn-link btn-unstyled facet-term ${(entry.isSelected())?then(\'facet-term-selected\', \'facet-term-unselected\')} tag-popularity-${entry.getPopularity()} term-name\"\n							data-term-id=\"${entry.getDisplayName()}\"\n							onClick=\"Liferay.Search.FacetUtil.changeSelection(event);\"\n						>\n							${htmlUtil.escape(entry.getDisplayName())}\n						</button>\n					</span>\n				</#list>\n			</#if>\n		</ul>\n	</@>\n</@>',0,20099,NULL,'2023-09-15 14:34:52.825000'),(0,0,33750,20121,20096,20099,NULL,'2023-09-15 14:34:52.828000',33744,0,33748,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Name language-id=\"sv_SE\">Kompakt layout</Name><Name language-id=\"pt_BR\">Layout compacto</Name><Name language-id=\"ja_JP\">コンパクトレイアウト</Name><Name language-id=\"fr_FR\">Disposition compacte</Name><Name language-id=\"hu_HU\">Kompakt elrendezés</Name><Name language-id=\"de_DE\">Kompaktes Layout</Name><Name language-id=\"ca_ES\">Disposició compacta</Name><Name language-id=\"ar_SA\">مخطط مضغوط</Name><Name language-id=\"fi_FI\">Tiivis Asettelu</Name><Name language-id=\"en_US\">Compact Layout</Name><Name language-id=\"zh_CN\">紧凑布局</Name><Name language-id=\"es_ES\">Diseño compacto</Name><Name language-id=\"nl_NL\">Compacte lay-out</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Visa villkoren som en lista med länkar.</Description><Description language-id=\"pt_BR\">Exibir termos como uma lista de links.</Description><Description language-id=\"ja_JP\">用語をリンクリストとして表示します。</Description><Description language-id=\"fr_FR\">Afficher les termes sous la forme de liste de liens.</Description><Description language-id=\"hu_HU\">Jelenítse meg a kifejezéseke