INSERT INTO `KaleoDefinition` VALUES (1,0,32642,0,20096,20099,NULL,'2023-09-15 14:34:35.874000','2023-09-15 14:34:35.931000','message-boards-user-stats-moderation','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,fr_FR,ja_JP,ca_ES,de_DE,hu_HU,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><title language-id=\"sv_SE\">Moderering av användarstatistik för diskussionsforum</title><title language-id=\"pt_BR\">Moderação de estatísticas de usuário do fórum</title><title language-id=\"fr_FR\">Modération sur statistiques utilisateur des forums de discussion</title><title language-id=\"ja_JP\">掲示板ユーザー統計の承認</title><title language-id=\"ca_ES\">Moderació de les estadístiques d\'usuari dels taulers de missatges</title><title language-id=\"de_DE\">Moderation der Foren-Benutzerstatistiken</title><title language-id=\"hu_HU\">Fórumok felhasználói statisztikáinak a moderálása</title><title language-id=\"ar_SA\">الإشراف على إحصاءات مستخدم لوحات الرسائل</title><title language-id=\"fi_FI\">Keskustelualueiden käyttäjätilastojen moderointi</title><title language-id=\"en_US\">Message Boards User Stats Moderation</title><title language-id=\"zh_CN\">留言板用户统计审核</title><title language-id=\"es_ES\">Moderación de estadísticas de usuario de los foros de discusión</title><title language-id=\"nl_NL\">Moderatiestatistieken forumgebruiker</title></root>','Users with a reputation over the threshold get their threads and comments approved automatically.','<?xml version=\"1.0\"?>\n\n<workflow-definition xmlns=\"urn:liferay.com:liferay-workflow_7.4.0\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:schemaLocation=\"urn:liferay.com:liferay-workflow_7.4.0 http://www.liferay.com/dtd/liferay-workflow-definition_7_4_0.xsd\">\n	<name>Message Board Threads and Comments Reputation Approver</name>\n	<description>Users with a reputation over the threshold get their threads and comments approved automatically.</description>\n	<version>1</version>\n	<conditi