submission was rejected by ${userName}.]]> </description>\n				<template> <![CDATA[Your submission was rejected by ${userName}, please modify and resubmit.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<notification-type>user-notification</notification-type>\n				<recipients receptionType=\"to\">\n					<user/>\n				</recipients>\n				<execution-type>onAssignment</execution-type>\n			</notification>\n		</actions>\n		<assignments>\n			<user/>\n		</assignments>\n		<transitions>\n			<transition>\n				<name>resubmit</name>\n				<target>review</target>\n				<default>true</default>\n			</transition>\n		</transitions>\n	</task>\n	<task>\n		<name>review</name>\n		<metadata> <![CDATA[\n				{\n					\"xy\": [\n						285,\n						186\n					]\n				}\n			]]> </metadata>\n		<actions>\n			<notification>\n				<name>Review Notification</name>\n				<description> <![CDATA[${userName} has sent you a ${entryType} for review]]> </description>\n				<template> <![CDATA[${userName} has sent you a ${entryType} for review in the workflow.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<notification-type>user-notification</notification-type>\n				<recipients receptionType=\"to\">\n					<assignees/>\n				</recipients>\n				<execution-type>onAssignment</execution-type>\n			</notification>\n			<notification>\n				<name>Review Completion Notification</name>\n				<description> <![CDATA[Your submission was reviewed by ${userName}.]]> </description>\n				<template> <![CDATA[Your submission was reviewed by ${userName}<#if taskComments?has_content> with the following comments: \"${taskComments}\"</#if>.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<recipients receptionType=\"to\">\n					<user/>\n				</recipients>\n				<execution-type>onExit</execution-type>\n			</notification>\n		</actions>\n		<assignments>\n			<roles>\n				<role>\n					<role-type>depot</role-type>\n					<name>Asset Library Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>organization</role-type>\n					<name>Organization Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>regular</role-type>\n					<name>Portal Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>site</role-type>\n					<name>Site Content Reviewer</name>\n				</role>\n			</roles>\n		</assignments>\n		<transitions>\n			<transition>\n				<name>approve</name>\n				<target>approved</target>\n				<default>true</default>\n			</transition>\n			<transition>\n				<name>reject</name>\n				<target>update</target>\n				<default>false</default>\n			</transition>\n		</transitions>\n	</task>\n</workflow-definition>','com.liferay.message.boards.model.MBMessage',1,1),(1,0,32701,0,20096,20099,NULL,'2023-09-15 14:34:36.135000','2023-09-15 14:34:36.169000','Single Approver','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE\" default-locale=\"en_US\"><title language-id=\"en_US\">Single Approver</title><title language-id=\"ar_SA\">مسؤول موافقة واحد</title><title language-id=\"ca_ES\">Aprovador únic</title><title language-id=\"zh_CN\">单个审批者</title><title language-id=\"nl_NL\">Enkele goedkeurder</title><title language-id=\"fi_FI\">Yksittäinen Hyväksyjä</title><title language-id=\"fr_FR\">Valideur unique</title><title language-id=\"de_DE\">Einzelne genehmigende Person</title><title language-id=\"hu_HU\">Egyetlen jóváhagyó</title><title language-id=\"ja_JP\">唯一の承認者</title><title language-id=\"pt_BR\">Aprovador Único</title><title language-id=\"es_ES\">Aprobador único</title><title language-id=\"sv_SE\">Enskild godkännare</title></root>','A single approver can approve a workflow content.','<?xml version=\"1.0\"?>\n\n<workflow-definition xmlns=\"urn:liferay.com:liferay-workflow_7.4.0\" xmlns