INSERT INTO `KaleoDefinitionVersion` VALUES (1,0,32643,0,20096,20099,NULL,'2023-09-15 14:34:35.878000','2023-09-15 14:34:35.933000',32642,'message-boards-user-stats-moderation','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,fr_FR,ja_JP,ca_ES,de_DE,hu_HU,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><title language-id=\"sv_SE\">Moderering av användarstatistik för diskussionsforum</title><title language-id=\"pt_BR\">Moderação de estatísticas de usuário do fórum</title><title language-id=\"fr_FR\">Modération sur statistiques utilisateur des forums de discussion</title><title language-id=\"ja_JP\">掲示板ユーザー統計の承認</title><title language-id=\"ca_ES\">Moderació de les estadístiques d\'usuari dels taulers de missatges</title><title language-id=\"de_DE\">Moderation der Foren-Benutzerstatistiken</title><title language-id=\"hu_HU\">Fórumok felhasználói statisztikáinak a moderálása</title><title language-id=\"ar_SA\">الإشراف على إحصاءات مستخدم لوحات الرسائل</title><title language-id=\"fi_FI\">Keskustelualueiden käyttäjätilastojen moderointi</title><title language-id=\"en_US\">Message Boards User Stats Moderation</title><title language-id=\"zh_CN\">留言板用户统计审核</title><title language-id=\"es_ES\">Moderación de estadísticas de usuario de los foros de discusión</title><title language-id=\"nl_NL\">Moderatiestatistieken forumgebruiker</title></root>','Users with a reputation over the threshold get their threads and comments approved automatically.','<?xml version=\"1.0\"?>\n\n<workflow-definition xmlns=\"urn:liferay.com:liferay-workflow_7.4.0\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:schemaLocation=\"urn:liferay.com:liferay-workflow_7.4.0 http://www.liferay.com/dtd/liferay-workflow-definition_7_4_0.xsd\">\n	<name>Message Board Threads and Comments Reputation Approver</name>\n	<description>Users with a reputation over the threshold get their threads and comments approved automatically.</description>\n	<version>1</version>\n	<condition>\n		<name>check-reputation</name>\n		<metadata> <![CDATA[\n				{\n					\"xy\": [\n						199,\n						43\n					]\n				}\n			]]> </metadata>\n		<script> <![CDATA[com.liferay.message.boards.moderation.internal.kaleo.runtime.condition.MBModerationConditionEvaluator]]> </script>\n		<script-language>java</script-language>\n		<transitions>\n			<transition>\n				<name>approve</name>\n				<target>approved</target>\n				<default>true</default>\n			</transition>\n			<transition>\n				<name>review</name>\n				<target>review</target>\n				<default>false</default>\n			</transition>\n		</transitions>\n	</condition>\n	<state>\n		<name>created</name>\n		<metadata> <![CDATA[\n				{\n					\"xy\": [\n						36,\n						51\n					]\n				}\n			]]> </metadata>\n		<initial>true</initial>\n		<transitions>\n			<transition>\n				<name>check-reputation</name>\n				<target>check-reputation</target>\n				<default>true</default>\n			</transition>\n		</transitions>\n	</state>\n	<state>\n		<name>approved</name>\n		<metadata> <![CDATA[\n				{\n					\"terminal\": true,\n					\"xy\": [\n						648,\n						50\n					]\n				}\n			]]> </metadata>\n		<actions>\n			<action>\n				<name>approve</name>\n				<status>0</status>\n				<execution-type>onEntry</execution-type>\n			</action>\n		</actions>\n	</state>\n	<task>\n		<name>update</name>\n		<metadata> <![CDATA[\n				{\n					\"transitions\": {\n						\"resubmit\": {\n							\"bendpoints\": [\n								[\n									303,\n									140\n								]\n							]\n						}\n					},\n					\"xy\": [\n						636,\n						245\n					]\n				}\n			]]> </metadata>\n		<actions>\n			<action>\n				<name>deny</name>\n				<status>4</status>\n				<priority>1</priority>\n				<execution-type>onAssignment</execution-type>\n			</action>\n			<action>\n				<name>pending</name>\n				<status>1</status>\n				<priority>2</priority>\n				<execution-type>onAssignment</execution-type>\n			</action>\n			<notification>\n				<name>Creator Modification Notification</name>\n				<description> <![CDATA[Your submission was rejected by ${userName}.]]> </description>\n				<template> <![CDATA[Your submission was rejected by ${userName}, please modify and resubmit.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<notification-type>user-notification</notification-type>\n				<recipients receptionType=\"to\">\n					<user/>\n				</recipients>\n				<execution-type>onAssignment</execution-type>\n			</notification>\n		</actions>\n		<assignments>\n			<user/>\n		</assignments>\n		<transitions>\n			<transition>\n				<name>resubmit</name>\n				<target>review</target>\n				<default>true</default>\n			</transition>\n		</transitions>\n	</task>\n	<task>\n		<name>review</name>\n		<metadata> <![CDATA[\n				{\n					\"xy\": [\n						285,\n						186\n					]\n				}\n			]]> </metadata>\n		<actions>\n			<notification>\n				<name>Review Notification</name>\n				<description> <![CDATA[${userName} has sent you a ${entryType} for review]]> </description>\n				<template> <![CDATA[${userName} has sent you a ${entryType} for review in the workflow.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<notification-type>user-notification</notification-type>\n				<recipients receptionType=\"to\">\n					<assignees/>\n				</recipients>\n				<execution-type>onAssignment</execution-type>\n			</notification>\n			<notification>\n				<name>Review Completion Notification</name>\n				<description> <![CDATA[Your submission was reviewed by ${userName}.]]> </description>\n				<template> <![CDATA[Your submission was reviewed by ${userName}<#if taskComments?has_content> with the following comments: \"${taskComments}\"</#if>.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<recipients receptionType=\"to\">\n					<user/>\n				</recipients>\n				<execution-type>onExit</execution-type>\n			</notification>\n		</actions>\n		<assignments>\n			<roles>\n				<role>\n					<role-type>depot</role-type>\n					<name>Asset Library Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>organization</role-type>\n					<name>Organization Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>regular</role-type>\n					<name>Portal Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>site</role-type>\n					<name>Site Content Reviewer</name>\n				</role>\n			</roles>\n		</assignments>\n		<transitions>\n			<transition>\n				<name>approve</name>\n				<target>approved</target>\n				<default>true</default>\n			</transition>\n			<transition>\n				<name>reject</name>\n				<target>update</target>\n				<default>false</default>\n			</transition>\n		</transitions>\n	</task>\n</workflow-definition>','1.0',32648,0,20099,NULL,'2023-09-15 14:34:35.878000'),(1,0,32702,0,20096,20099,NULL,'2023-09-15 14:34:36.140000','2023-09-15 14:34:36.169000',32701,'Single Approver','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,ar_SA,ca_ES,zh_CN,nl_NL,fi_FI,fr_FR,de_DE,hu_HU,ja_JP,pt_BR,es_ES,sv_SE\" default-locale=\"en_US\"><title language-id=\"en_US\">Single Approver</title><title language-id=\"ar_SA\">مسؤول موافقة واحد</title><title language-id=\"ca_ES\">Aprovador únic</title><title language-id=\"zh_CN\">单个审批者</title><title language-id=\"nl_NL\">Enkele goedkeurder</title><title language-id=\"fi_FI\">Yksittäinen Hyväksyjä</title><title language-id=\"fr_FR\">Valideur unique</title><title language-id=\"de_DE\">Einzelne genehmigende Person</title><title language-id=\"hu_HU\">Egyetlen jóváhagyó</title><title language-id=\"ja_JP\">唯一の承認者</title><title language-id=\"pt_BR\">Aprovador Único</title><title language-id=\"es_ES\">Aprobador único</title><title language-id=\"sv_SE\">Enskild godkännare</title></root>','A single approver can approve a workflow content.','<?xml version=\"1.0\"?>\n\n<workflow-definition xmlns=\"urn:liferay.com:liferay-workflow_7.4.0\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:schemaLocation=\"urn:liferay.com:liferay-workflow_7.4.0 http://www.liferay.com/dtd/liferay-workflow-definition_7_4_0.xsd\">\n	<name>Single Approver</name>\n	<description>A single approver can approve a workflow content.</description>\n	<version>1</version>\n	<state>\n		<name>created</name>\n		<metadata> <![CDATA[\n				{\n					\"xy\": [\n						165,\n						76\n					]\n				}\n			]]> </metadata>\n		<initial>true</initial>\n		<transitions>\n			<transition>\n				<name>review</name>\n				<target>review</target>\n				<default>true</default>\n			</transition>\n		</transitions>\n	</state>\n	<state>\n		<name>approved</name>\n		<metadata> <![CDATA[\n				{\n					\"terminal\": true,\n					\"xy\": [\n						539,\n						74\n					]\n				}\n			]]> </metadata>\n		<actions>\n			<action>\n				<name>approve</name>\n				<status>0</status>\n				<execution-type>onEntry</execution-type>\n			</action>\n		</actions>\n	</state>\n	<task>\n		<name>update</name>\n		<metadata> <![CDATA[\n				{\n					\"transitions\": {\n						\"resubmit\": {\n							\"bendpoints\": [\n								[\n									303,\n									140\n								]\n							]\n						}\n					},\n					\"xy\": [\n						164,\n						533\n					]\n				}\n			]]> </metadata>\n		<actions>\n			<action>\n				<name>deny</name>\n				<status>4</status>\n				<priority>1</priority>\n				<execution-type>onAssignment</execution-type>\n			</action>\n			<action>\n				<name>pending</name>\n				<status>1</status>\n				<priority>2</priority>\n				<execution-type>onAssignment</execution-type>\n			</action>\n			<notification>\n				<name>Creator Modification Notification</name>\n				<template> <![CDATA[Your submission was rejected by ${userName}, please modify and resubmit.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<notification-type>user-notification</notification-type>\n				<recipients receptionType=\"to\">\n					<user/>\n				</recipients>\n				<execution-type>onAssignment</execution-type>\n			</notification>\n		</actions>\n		<assignments>\n			<user/>\n		</assignments>\n		<transitions>\n			<transition>\n				<name>resubmit</name>\n				<target>review</target>\n				<default>true</default>\n			</transition>\n		</transitions>\n	</task>\n	<task>\n		<name>review</name>\n		<metadata> <![CDATA[\n				{\n					\"xy\": [\n						165,\n						292\n					]\n				}\n			]]> </metadata>\n		<actions>\n			<notification>\n				<name>Review Notification</name>\n				<template> <![CDATA[${userName} sent you a ${entryType} for review in the workflow.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<notification-type>user-notification</notification-type>\n				<recipients receptionType=\"to\">\n					<assignees/>\n				</recipients>\n				<execution-type>onAssignment</execution-type>\n			</notification>\n			<notification>\n				<name>Review Completion Notification</name>\n				<template> <![CDATA[Your submission was reviewed<#if taskComments?has_content> and the reviewer applied the following ${taskComments}</#if>.]]> </template>\n				<template-language>freemarker</template-language>\n				<notification-type>email</notification-type>\n				<recipients receptionType=\"to\">\n					<user/>\n				</recipients>\n				<execution-type>onExit</execution-type>\n			</notification>\n		</actions>\n		<assignments>\n			<roles>\n				<role>\n					<role-type>account</role-type>\n					<name>Account Administrator</name>\n				</role>\n				<role>\n					<role-type>account</role-type>\n					<name>Account Member</name>\n				</role>\n				<role>\n					<role-type>depot</role-type>\n					<name>Asset Library Administrator</name>\n				</role>\n				<role>\n					<role-type>depot</role-type>\n					<name>Asset Library Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>depot</role-type>\n					<name>Asset Library Owner</name>\n				</role>\n				<role>\n					<role-type>organization</role-type>\n					<name>Organization Administrator</name>\n				</role>\n				<role>\n					<role-type>organization</role-type>\n					<name>Organization Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>organization</role-type>\n					<name>Organization Owner</name>\n				</role>\n				<role>\n					<role-type>regular</role-type>\n					<name>Administrator</name>\n				</role>\n				<role>\n					<role-type>regular</role-type>\n					<name>Portal Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>site</role-type>\n					<name>Site Administrator</name>\n				</role>\n				<role>\n					<role-type>site</role-type>\n					<name>Site Content Reviewer</name>\n				</role>\n				<role>\n					<role-type>site</role-type>\n					<name>Site Owner</name>\n				</role>\n			</roles>\n		</assignments>\n		<transitions>\n			<transition>\n				<name>approve</name>\n				<target>approved</target>\n				<default>true</default>\n			</transition>\n			<transition>\n				<name>reject</name>\n				<target>update</target>\n				<default>false</default>\n			</transition>\n		</transitions>\n	</task>\n</workflow-definition>','1.0',32705,0,20099,NULL,'2023-09-15 14:34:36.140000');
