ores da Biblioteca de Ativos.</Description><Description language-id=\"ja_JP\">アセットライブラリの管理者はそれぞれのアセットライブラリのスーパーユーザーですが、他のユーザーをアセットライブラリの管理者にすることはできません。</Description><Description language-id=\"fr_FR\">Les administrateurs d\'un dépôt sont des super utilisateurs de leur dépôt, mais ne peuvent rendre administrateurs d\'autres utilisateurs.</Description><Description language-id=\"hu_HU\">Az adattár adminisztrátorai adattáruk magasabbrendű felhasználói, de nem nevezhetnek ki más felhasználókat az adattár adminisztrátoraivá.</Description><Description language-id=\"de_DE\">Repository-Administratoren sind Administratoren ihres Repositorys, können aber andere Benutzer nicht zu Repository-Administratoren machen.</Description><Description language-id=\"ca_ES\">Els administradors de la biblioteca de continguts són superusuaris de la seva biblioteca de continguts, però no poden assignar el rol d\'administrador de biblioteca de continguts a altres usuaris.</Description><Description language-id=\"ar_SA\">مسؤولو مكتبة الأصول هم مستخدمون متميزون لمكتبة الأصول الخاصة بهم ولكن لا يمكنهم تعيين مستخدمين آخرين كمسئولين لمكتبة الأصول.</Description><Description language-id=\"fi_FI\">Sisältökirjaston Pääkäyttäjät ovat sisältökirjastonsa superkäyttäjiä, mutta eivät voi tehdä muista käyttäjistä Sisältökirjaston Pääkäyttäjiä.</Description><Description language-id=\"en_US\">Asset Library Administrators are super users of their asset library but cannot make other users into Asset Library Administrators.</Description><Description language-id=\"zh_CN\">资产库管理员是其资产库的超级用户，但不能使其他用户成为资产库管理员。</Description><Description language-id=\"es_ES\">Los administradores del repositorio son superusuarios de su repositorio, pero no pueden convertir a otros usuarios en administradores del repositorio.</Description><Description language-id=\"nl_NL\">Assetbibliotheekbeheerders zijn supergebruikers van hun assetbibliotheek, maar kunnen geen assetbibliotheekbeheerders maken van andere gebruikers.</Description></root>',5,NULL),(0,0,'a78a25a5-ee47-3603-59f2-248dd9a9691a',20143,20096,20099,NULL,'2023-09-15 14:33:43.210000','2023-09-15 14:33:43.210000',20065,20143,'Asset Library Connected Site Member',NULL,'',5,NULL),(0,0,'b49b4bcb-9362-11ea-cd86-2599b5f706f5',20144,20096,20099,NULL,'2023-09-15 14:33:43.212000','2023-09-15 14:33:43.212000',20065,20144,'Asset Library Content Reviewer',NULL,'',5,NULL),(0,0,'6179b323-ab32-2a04-e010-5f909c9bd132',20145,20096,20099,NULL,'2023-09-15 14:33:43.215000','2023-09-15 14:33:43.215000',20065,20145,'Asset Library Member',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Alla användare som tillhör ett tillgångsbibliotek har den här rollen i det tillgångsbiblioteket.</Description><Description language-id=\"pt_BR\">Todos os usuários que pertencem a uma biblioteca de ativos possuem esta função nessa biblioteca de ativos.</Description><Description language-id=\"ja_JP\">アセットライブラリに属している全ユーザーは、このアセットライブラリでこのロールを割り当てられています。</Description><Description language-id=\"fr_FR\">Tous les utilisateurs qui appartiennent à un dépôt ont ce rôle au sein de ce dépôt.</Description><Description language-id=\"hu_HU\">Egy adattárhoz tartozó összes felhasználó ezzel a szerepkörrel rendelkezik az adattáron belül.</Description><Description language-id=\"de_DE\">Alle Benutzer, die zu einem Repository gehören, haben diese Rolle innerhalb dieses Repositorys inne.</Description><Description language-id=\"ca_ES\">Tots els usuaris que pertanyin a una biblioteca de continguts tenen aquest rol en aquesta biblioteca de continguts.</Description><Description language-id=\"ar_SA\">جميع المستخدمين الذين ينتمون إلى مكتبة أصول ما لديهم هذا الدور داخل مكتبة الأصول تلك.</Description><Description language-id=\"fi_FI\">Kaikilla käyttäjillä, jotka kuuluvat sisältökirjastoon, on tämä rooli kyseisen sisältökirjaston sisällä.</Description><Description language-id=\"en_US\">All users who belong to an asset library have this role within that asset library.</Description><Description language-id=\"zh_CN\">属于资产库的所有用户都具有该资产库中的此角色。</Description><Description language-id=\"es_ES\">Todos los usuarios que pertenecen a un repositorio tienen este rol en ese repositorio.</Description><Description language-id=\"nl_NL\">Alle gebruikers die bij een assetbibliotheek horen, hebben deze rol in die assetbibliotheek.</Description></root>',5,NULL),(0,0,'2096d984-8f53-30e1-e8a3-e486275b288f',20146,20096,20099,NULL,'2023-09-15 14:33:43.218000','2023-09-15 14:33:43.218000',20065,20146,'Asset Library Owner',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,sv_SE,pt_BR,ja_JP,fr_FR,hu_HU,de_DE,ca_ES,ar_SA,fi_FI,zh_CN,es_ES,nl_NL\" default-locale=\"en_US\"><Description language-id=\"sv_SE\">Administratörer av tillgångsbibliotek är superanvändare av sitt tillgångsbibliotek och kan tilldela roller i tillgångsbiblioteket till användare.</Description><Description language-id=\"pt_BR\">Os Proprietários de Bibliotecas de Ativo são super usuários de suas bibliotecas de ativo e podem atribuir funções da biblioteca de ativos a outros usuários.</Description><Description language-id=\"ja_JP\">アセットライブラリの所有者は、それぞれのアセットライブラリのスーパーユーザーであり、ユーザーにアセットライブラリのロールを割り当てることができます。</Description><Description language-id=\"fr_FR\">Les propriétaires d\'un dépôt sont des super utilisateurs de ce dépôt et peuvent affecter des rôles à des utilisateurs.</Description><Description language-id=\"hu_HU\">Az adattár tulajdonosai adattáruk magasabbrendű felhasználói, és adattár szerepköröket rendelhetnek hozzá más felhasználókhoz.</Description><Description language-id=\"de_DE\">Besitzer von Assetbibliotheken sind Administratoren ihrer Assetbibliothek und können Benutzern Assetbibliothek-Rollen zuweisen.</Description><Description language-id=\"ca_ES\">Els propietaris de la biblioteca de continguts són superusuaris de la seva biblioteca de continguts, i poden assignar rols de la biblioteca de continguts als usuaris.</Description><Description language-id=\"ar_SA\">مالكو مكتبة الأصول هم مستخدمون متميزون لمكتبة الأصول الخاصة بهم ويمكنهم تعيين أدوار مكتبة الأصول إلى المستخدمين.</Description><Description language-id=\"fi_FI\">Sisältökirjaston Omistajat ovat sisältökirjastonsa superkäyttäjiä, ja voivat liittää sisältökirjaston rooleja käyttäjille.</Description><Description language-id=\"en_US\">Asset Library Owners are super users of their asset library and can assign asset library roles to users.</Description><Description language-id=\"zh_CN\">资产库所有者是其资产库的超级用户，且可以将资产库角色分配给用户。</Description><Description language-id=\"es_ES\">Los propietarios de repositorio son superusuarios de su repositorio y pueden asignar roles de repositorio a otros usuarios.</Description><Description language-id=\"nl_NL\">Assetbibliotheekeigenaars zijn supergebruikers van hun assetbibliotheek en kunnen assetbibliotheekrollen toewijzen aan gebruikers.</Description></root>',5,NULL),(1,0,'fe14265f-1e8b-6127-b03b-7aba147a9d6f',32216,20096,20099,NULL,'2023-09-15 14:34:31.351000','2023-09-15 14:34:31.353000',31910,32217,'Account Member',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">All users who belong to an account have this role within that account.</Description></root>',6,NULL),(1,0,'de778403-e65c-e52c-2f60-d9bb8ed9195e',32219,20096,20099,NULL,'2023-09-15 14:34:31.360000','2023-09-15 14:34:31.361000',31910,32220,'Account Administrator',NULL,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Description language-id=\"en_US\">Account Administrators are super users of their account.</Description></root>',6,NULL),(0,0,'aa05426a-b5fb-8bd5-b578-bbe11403174d',32222,20096,20099,NULL,'2023-09-15 14:34:31.363000','2023-09-15 14:34:31.363000',20065,32222,'Account Manager',NULL,'<?xml version=\'1.0\' encoding=\